00","endDate":"2017-01-17 18:00:00"}],"topLineInfo":"The Crocodile Presents:","promoterName":"The Crocodile Presents:","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":"ALL_AGES","ageLimit":"All Ages","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1377258?utm_medium=api","ticketPrice":"$12 Adv.","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":109102649569001,"facebookEventIdString":"109102649569001","headliners":[{"id":1765205,"name":"Great Good Fine Ok","startTime":null,"eventDescription":"Is it possible to be nostalgic for the future? Brooklyn synthpop duo Great Good Fine Ok met one evening in 2013 and by the next morning had written their first song together, “You’re the One for Me,” a gauzy, heart-thumping anthem that hit #1 on Hype Machine twice in one month and instantly established the group’s sound with Jon Sandler’s dancefloor falsetto soaring over Luke Moellman’s lush post-Space Age production, the perfect soundtrack for retrofuturism.

An EP, Body Diamond, soon followed, as did a slate of shows at that year’s SXSW festival and a deal with Neon Gold and Epic Records. In 2014 GGFO’s second EP, 2M2H, reached #10 on the iTunes dance chart and featured the St. Lucia collaboration “Something to Believe In,” which premiered on Entertainment Weekly. In keeping with this collaborative spirit, GGFO co-wrote and performed on The Chainsmoker’s single “Let You Go,” recorded a cover of Phil Collins’s “Easy Lover” with fellow Brooklynite Panama Wedding, and produced the song “Shapeshifting” with Irish folk-pop singer Orla Gartland, whom Jon and Luke met after their headlining show at Notting Hill Arts Club in London. They have also remixed songs by St Lucia, Foxes, Twenty One Pilots, Luxley, Little Daylight, and many others.

In the past three years, GGFO have performed shows supporting acts ranging from Tove Lo to X Ambassadors to Penguin Prison and have embarked on four major US tours with Betty Who, Joywave, Magic Man, Vacationer, and Panama Wedding, with four songs reaching #1 on Hype Machine and their single “Take It or Leave It” surpassing ten million plays on Spotify. As anyone who attended the group’s recent sold-out Northeast headlining tour can attest, GGFO has amassed a large contingent of loyal fans who have come to expect over-the-top live performances involving silk kimonos, triggered lights, and histrionic keytar solos, with Jon and Luke backed by drummer Danny Wolf and guitarist Carey Clayton. 2016 has already seen the release of three singles and an EP of GGFO songs remixed by like-minded artists, with more new works ever looming on the horizon. Music blog Indie Shuffle says, “I dare you to find another group in the past two years who has been so prolific and consistent with their releases while at the same time delivering some of the most heavenly signature falsetto vocals known to man.”","isMobileFriendly":"true","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atjmbo.JPG","width":960,"height":708},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atjmbo1.JPG","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atlg.JPG","width":300,"height":221},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atlg1.JPG","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atmd.JPG","width":200,"height":148},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atmd1.JPG","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-og.JPG","width":2048,"height":1511},"small":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atsm.JPG","width":100,"height":74},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/36/85/82-atsm1.JPG","width":100,"heigh